import React from 'react';

const agentData = {
  타격대: [
    { name: '네온', image: 'https://static.wikia.nocookie.net/valorant/images/b/b3/Neon_icon.png' },
    { name: '레이나', image: 'https://static.wikia.nocookie.net/valorant/images/2/25/Reyna_icon.png' },
    { name: '레이즈', image: 'https://static.wikia.nocookie.net/valorant/images/2/2c/Raze_icon.png' },
    { name: '아이소', image: 'https://static.wikia.nocookie.net/valorant/images/1/14/Iso_icon.png' },
    { name: '요루', image: 'https://static.wikia.nocookie.net/valorant/images/4/45/Yoru_icon.png' },
    { name: '웨이레이', image: 'https://static.wikia.nocookie.net/valorant/images/a/a0/Deadeye_icon.png' }, // 가명?
    { name: '제트', image: 'https://static.wikia.nocookie.net/valorant/images/4/4e/Jett_icon.png' },
    { name: '피닉스', image: 'https://static.wikia.nocookie.net/valorant/images/7/70/Phoenix_icon.png' },
  ],
  척후대: [
    { name: '게코', image: 'https://static.wikia.nocookie.net/valorant/images/3/38/Gekko_icon.png' },
    { name: '브리치', image: 'https://static.wikia.nocookie.net/valorant/images/2/2e/Breach_icon.png' },
    { name: '소바', image: 'https://static.wikia.nocookie.net/valorant/images/6/6b/Sova_icon.png' },
    { name: '스카이', image: 'https://static.wikia.nocookie.net/valorant/images/2/23/Skye_icon.png' },
    { name: '케이/오', image: 'https://static.wikia.nocookie.net/valorant/images/f/f9/KAYO_icon.png' },
    { name: '테호', image: 'https://static.wikia.nocookie.net/valorant/images/2/28/T%C3%98R_icon.png' }, // TØR = 테호 (추정)
    { name: '페이드', image: 'https://static.wikia.nocookie.net/valorant/images/1/17/Fade_icon.png' },
  ],
  감시자: [
    { name: '데드록', image: 'https://static.wikia.nocookie.net/valorant/images/0/09/Deadlock_icon.png' },
    { name: '바이스', image: 'https://static.wikia.nocookie.net/valorant/images/f/fc/Cypher_icon.png' }, // 바이스 정보 정확 확인 필요
    { name: '사이퍼', image: 'https://static.wikia.nocookie.net/valorant/images/f/fc/Cypher_icon.png' },
    { name: '세이지', image: 'https://static.wikia.nocookie.net/valorant/images/4/4c/Sage_icon.png' },
    { name: '체임버', image: 'https://static.wikia.nocookie.net/valorant/images/b/b6/Chamber_icon.png' },
    { name: '킬조이', image: 'https://static.wikia.nocookie.net/valorant/images/8/81/Killjoy_icon.png' },
  ],
  전략가: [
    { name: '바이퍼', image: 'https://static.wikia.nocookie.net/valorant/images/6/6e/Viper_icon.png' },
    { name: '브림스톤', image: 'https://static.wikia.nocookie.net/valorant/images/1/1a/Brimstone_icon.png' },
    { name: '아스트라', image: 'https://static.wikia.nocookie.net/valorant/images/4/4f/Astra_icon.png' },
    { name: '오멘', image: 'https://static.wikia.nocookie.net/valorant/images/0/0d/Omen_icon.png' },
    { name: '클로브', image: 'https://static.wikia.nocookie.net/valorant/images/f/fc/Clove_icon.png' },
    { name: '하버', image: 'https://static.wikia.nocookie.net/valorant/images/5/5b/Harbor_icon.png' },
  ],
};

function AgentsPage() {
  return (
    <div style={styles.container}>
      <h1 style={styles.title}>발로란트 요원 목록</h1>
      {Object.entries(agentData).map(([role, agents]) => (
        <div key={role}>
          <h2 style={styles.roleTitle}>{role}</h2>
          <div style={styles.grid}>
            {agents.map((agent, index) => (
              <div key={index} style={styles.card}>
                <img src={agent.image} alt={agent.name} style={styles.image} />
                <div style={styles.name}>{agent.name}</div>
              </div>
            ))}
          </div>
        </div>
      ))}
    </div>
  );
}

const styles = {
  container: {
    padding: '60px 20px',
    backgroundColor: '#f5f5f5',
    color: '#333',
    minHeight: '100vh',
    textAlign: 'center',
  },
  title: {
    fontSize: '36px',
    marginBottom: '40px',
  },
  roleTitle: {
    fontSize: '28px',
    margin: '40px 0 20px',
    color: '#111',
  },
  grid: {
    display: 'flex',
    flexWrap: 'wrap',
    justifyContent: 'center',
    gap: '30px',
  },
  card: {
    backgroundColor: '#fff',
    borderRadius: '10px',
    padding: '20px',
    width: '150px',
    boxShadow: '0 4px 8px rgba(0,0,0,0.1)',
  },
  image: {
    width: '100%',
    borderRadius: '10px',
  },
  name: {
    marginTop: '10px',
    fontSize: '18px',
    fontWeight: 'bold',
  },
};

export default AgentsPage;
